    id : string;
    owner: string;
    content: string;
    created_date: string;
    important : string
}

const DisplayData = ({library} : any) => {
    const [content, setContent] = useState([])

    useEffect(() => {
        axios
            .get(`http://127.0.0.1:5000/${library}/getData`)
            .then(response => response.data.data)
            .then(response => {
                setContent(content.concat(response))
                console.log("Reponse from data", response)
            })
